// ------------------ '(◣_◢)' ------------------
  render(){
    return(
      <div className="black-back" style={{textAlign: "right"}}>
        <Container>
          <Row>
            <Col>
                <Stack />
            </Col>
              <Col>
                  <br />
                  <p className="blue-font">Supporting-Web-Aesthetics::genesis node of gita.network</p>
                  <hr />
                  <p className="red-font">A bunch of punks getting serious about creating value on the web.</p>
                  <p className="yellow-font">Bitcoin: 36BcJDwCRJgPq6nbYf5iXe6xWzMrjS6G1Q </p>
                  <p className="white-font">EOS: eosmainmenon</p>
                  <hr />
              </Col>

          </Row>
        </Container>

      </div>

      );
  }
// ------------------ '(◣_◢)' ------------------

}
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------

